import React from 'react';
import s from "./Navbar.module.css";
import { NavLink } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className={s.nav}>
            <div className={s.item}><NavLink to="/profile" activeClassName>Profile</NavLink></div>
            <div className={s.item}><NavLink to="/messages" activeClassName>Messages</NavLink></div>
            <div className={s.item}><NavLink to="/news" activeClassName>News</NavLink></div>
            <div className={s.item}><NavLink to="/musics" activeClassName>Music</NavLink></div>
            <div className={s.item}><NavLink to="/settings" activeClassName>Settings</NavLink></div>
        </nav>
    );
}

export default Navbar;
